package com.example.weather.repository;import lombok.Getter;import lombok.Setter;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Table;@Entity@Table(name = "coord")@Getter@Setterpublic class CoordEntity extends BaseEntity{    @Column(name = "coord_ref_Id")    public void setRefId(Long refId){        super.setRefId(refId);    }    @Column    private double lon;    @Column    private double lat;}